import React, { useState } from 'react';


const RangeSlider = () => {


  return (

    <input
        type="range"
        name="height"
        value={divHeight}
        onChange={e => setDivHeight(e.target.value)}
        min="1"
        max="500"
    />

  );

}

export default RangeSlider;
